import{Plugin}from 'ckeditor5/src/core';export default class DrupalImageUploadEditing extends Plugin{init(){const{editor}=this;const imageUploadEditing=editor.plugins.get('ImageUploadEditing');imageUploadEditing.on('uploadComplete',(evt,{data,imageElement})=>{editor.model.change((writer)=>{writer.setAttribute('dataEntityUuid',data.response.uuid,imageElement);writer.setAttribute('dataEntityType',data.response.entity_type,imageElement,)})})}
static get pluginName(){return'DrupalImageUploadEditing'}}